export const translateMissionType = (status_id, missionTypes) => {
  console.log(status_id, missionTypes);
  if (missionTypes) {
    Object.keys(missionTypes).map((element) => {
      console.log(element.label);
      if (element.id === status_id) {
        return element.label;
      } else return "N/C";
    });
  }
};
